import React from "react";

const images = [
        '../src/assets/blue.png',
        '../src/assets/pink.jpg',
        '../src/assets/plain.png',
        '../src/assets/rasberry.png',
        '../src/assets/sugar.png'
        ];

function Card(props) {
    for (var i=0; i < images.length; i++) {
       return (
            <div className='card'>Card</div>
        ); 
    }
}

export default Card;
